INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 2, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 3, 4, 10, 4, "vo_minigame_1012_result_2092", 3001, 2, 4.29, 2, 22300160);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 3, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 6, 4, 8, 4, "vo_minigame_1012_result_2093", 3001, 2, 4.64, 2, 22300161);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 3, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 0, 4, 5, 9, "vo_minigame_1012_result_2094", 3001, 2, 3.14, 2, 22300162);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 3, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 0, 4, 4, 7, "vo_minigame_1012_result_2095", 3001, 2, 6.59, 2, 22300163);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 0, 0, 3, 3, "vo_minigame_1012_result_2096", 3001, 2, 0.0, 2, 22300164);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 5, 0, 10, 9, "vo_minigame_1012_result_2097", 3001, 2, 2.2, 2, 22300165);
