INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 6, 0, 4, 9, "vo_minigame_1012_result_2100", 3001, 2, 3.22, 2, 22300168);
